      on either Schedule B supporting Line 21(b) of the Detailed Summary Page or Schedule
      H4 supporting Line 21(a) (i) and (ii) of the Detailed Summary Page.    The Committee
      uses best efforts procedures to identify all individuals that contribute over
      $200 in a calendar year that comply with federal law. An original solicitation
      always includes an accurate and clear statement of the laws requirements for
      the collection  and reporting of a contributors full name, mailing address,
      occupation and name of employer.     If the contributor does not provide sufficient
      reporting information when making a contribution, we send at least one letter
      requesting the missing information within 30 days of receipts of any donation
      that exceeds the $200 threshold. When oral requests are made it is documented
      in writing. The request includes an accurate and clear statement of the law
      requiring the collection and reporting of contributor information, that this
      is not a solicitation for a contribution and it does not include material on
      any other subject. If the request is written we include a pre-addresses stamped
      envelope, a fax number, telephone number and an email address for the contributor
      to respond. We also thank them for their contribution and for their cooperation
      in complying with the reporting requirements.
